selector_to_html = {"a[href=\"#load-the-data\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Load the data<a class=\"headerlink\" href=\"#load-the-data\" title=\"Permalink to this heading\">\uf0c1</a></h2><p>The dataset consists of 89782 cells comprising ~ 7000 cells randomly sampled across each time point.</p>", "a[href=\"#animated-trajectory\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Animated Trajectory<a class=\"headerlink\" href=\"#animated-trajectory\" title=\"Permalink to this heading\">\uf0c1</a></h3><p>Fine grained vector fields in action</p>", "a[href=\"#streamplots-for-cytof-data\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Streamplots for Cytof data<a class=\"headerlink\" href=\"#streamplots-for-cytof-data\" title=\"Permalink to this heading\">\uf0c1</a></h3><p>The cluster-level trajectory is projected onto the 2D embedding to visualize the more fine-grained progression</p>", "a[href=\"#using-umap-instead-of-via-s-cartographic-embeddings\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Using UMAP instead of Via\u2019s cartographic embeddings<a class=\"headerlink\" href=\"#using-umap-instead-of-via-s-cartographic-embeddings\" title=\"Permalink to this heading\">\uf0c1</a></h3><p>As shown below, if once uses UMAP instead of the TI adjusted embedding from Via, then the early and late stages are disconnected</p>", "a[href=\"#using-time-series-metadata-mesc-cytof\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">5. Using time-series metadata (mESC Cytof)<a class=\"headerlink\" href=\"#using-time-series-metadata-mesc-cytof\" title=\"Permalink to this heading\">\uf0c1</a></h1><p>In many developmental or longitudinal studies, the ages, experimental or developmental times are known. When such sampling point metadata are available, they can prove useful in guiding the graph construction and elucidating downstream analysis.\nThe bottom of this tutorial shows what happens to the TI and visualization when you do not use the (time-series) sequential information to guide the analysis.</p><p>This example uses a mouse embryonic stem cell (mESC) differentiation time course collected with mass cytometry. This particularly example looks at the cells cultured in conditions favouring differentiation into the mesoderm lineage. Samples are collected over an 11 day period.</p>", "a[href=\"#initialize-and-run-via\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Initialize and run VIA<a class=\"headerlink\" href=\"#initialize-and-run-via\" title=\"Permalink to this heading\">\uf0c1</a></h2><p>You can play around with the graph-pruning parameters impacting the clustering granularity</p>", "a[href=\"#draw-the-atlas-view-with-connectivities\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Draw The Atlas View with connectivities<a class=\"headerlink\" href=\"#draw-the-atlas-view-with-connectivities\" title=\"Permalink to this heading\">\uf0c1</a></h3><p>A visualization unique to Via that combines the high-resolution edge and single-cell layouts</p>", "a[href=\"#time-series-sequential-metadata-related-paramters\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Time-series/sequential metadata related paramters<a class=\"headerlink\" href=\"#time-series-sequential-metadata-related-paramters\" title=\"Permalink to this heading\">\uf0c1</a></h3><p>In order to guide the trajectory inference with the available time-series labels, we need to set certain parameters.</p>", "a[href=\"#the-atlas-embedding\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">The Atlas Embedding<a class=\"headerlink\" href=\"#the-atlas-embedding\" title=\"Permalink to this heading\">\uf0c1</a></h3><p>We use the knn-graph constructed in VIA which incorporates the sequential information in order to generate a 2D embedding of the data</p>", "a[href=\"#not-using-time-series-data-to-guide-the-analysis\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Not using time-series data to guide the analysis<a class=\"headerlink\" href=\"#not-using-time-series-data-to-guide-the-analysis\" title=\"Permalink to this heading\">\uf0c1</a></h2><p>When choosing not to use the available experimental time-stamps, we see that the overall Trajectory is more difficult to interpret and chronology is less clear (as seen when plotting the viagraph below)</p>", "a[href=\"#terminal-states-and-pathways\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Terminal states and pathways<a class=\"headerlink\" href=\"#terminal-states-and-pathways\" title=\"Permalink to this heading\">\uf0c1</a></h3><p>The high-level direction from root to different final states is shown here. The final states are marked in yellow</p>", "a[href=\"#plot-the-viagraph\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Plot the viagraph<a class=\"headerlink\" href=\"#plot-the-viagraph\" title=\"Permalink to this heading\">\uf0c1</a></h3><p>Note that the clusters circled in red correspond to the identified (predicted) terminal fates and since we know the time-samples, we can see they correspond to cells in the final stages of development from Day 10-11.</p>", "a[href=\"#protein-marker-dynamics\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Protein Marker Dynamics<a class=\"headerlink\" href=\"#protein-marker-dynamics\" title=\"Permalink to this heading\">\uf0c1</a></h3><p>We expect the lineages associated with the differentiated mesoderm cells(Day 10/11 cells) to show an increase in <em>Cd44, gata4</em> and <em>pdgfra</em> and a decrease in <em>Epcam</em>\nThe Epcam high Lineage from Cluster 15 actually contains several day 9/10 cells</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
